‚ÄúHaving no security in Afghanistan was an issue for us‚Ä¶ As well as there was clan discrimination,‚Äù says Morteza Rezaie (30) who identifies as part of the Hazara ethnic minority group. ‚ÄúThey have restricted Hazaras in all ways,‚Äù he says, adding that being Christian added another layer of conflict with his family. So Morteza, his wife, and two children left Iran, where they had been living, for Greece. ‚ÄúThe route that we came through water felt like we died once,‚Äù he recalls. Being far from family has also made him feel homesick and sad, he says, but focusing on his children's future helps: ‚ÄúOne day my son can become a scientist, a good student, or a good and useful citizen in society, and this gives us hope every day.‚Äù He also has dreams for his career: ‚ÄúMy dream for the future is to get accepted here and‚Ä¶ Continue my education at a senior level and be a teacher and achieve all the things I had in my dream,‚Äù he says. ‚ÄúI don‚Äôt want my dreams to be buried in my chest and not reach them.‚Äù Photo and interview by @mahdiyh_0_ 
