#1000Dreams supports #refugees to tell their stories - their strengths, their challenges, their dreams - for themselves.  40 refugee storytellers in #Europe have been trained & mentored by @Witness_Change. They are producing 1000 #portraits and interviews of other refugees on the continent. They are taking back control of their narrative. #refugeestories Support their work by sharing this story.
